/** Specifies the file format of an image. */
export enum ImageFormat {
    /** Bitmap image format. */
    Bmp,
    /** Enhanced metafile image format. */
    Emf,
    /** Graphics Interchange Format image format. */
    Gif,
    /** Joint Photographic Experts Group image format. */
    Jpeg,
    /** W3C Portable Network Graphics image format. */
    Png,
    /** Tagged Image File Format image format. */
    Tiff,
    /** Windows metafile image format. */
    Wmf,
}
